import React,{useState,useEffect} from 'react'
import Button from '@material-ui/core/Button'
import '../../styles/BandeauTop.css';

const BoutonAction = ({
    action,
    nb
}) => {
    

    return (  
        <Button className="bouton-action" variant="contained" disableElevation>

                <span class="title-action">{action+"\n"}</span>

                {nb>1 ? 
                <span class="count-action">{nb+" interventions"}</span>

                :

                <span class="count-action">{nb+" intervention"}</span>
                }
            
            
        </Button>
            
       

    );
}
 
export default BoutonAction;
